(function(){var o="http://localhost:3000/";var n={name:"New Room",operations:[{name:"Operation 1",amount:100,contributions:[{person:"Loh",paidAmount:100,ownsAmount:0},{person:"Pidr",paidAmount:0,ownsAmount:0}]},{name:"Operation 2",amount:100,contributions:[{person:"Loh",paidAmount:10,ownsAmount:0},{person:"TNK",paidAmount:50,ownsAmount:0}]}]};this.api={root:function(){$.ajax({url:o,method:"GET"}).done(function(o){console.log(o)})},all:function(){$.ajax({url:o+"roomIds",method:"GET"}).done(function(o){console.log(o)})},room:function(n){$.ajax({url:o+"room/"+n,method:"GET"}).done(function(o){console.log(o)})},create:function(){$.ajax({url:o+"room",method:"PUT",data:n}).done(function(o){console.log(o)})},update:function(n,t){$.ajax({url:o+"room/"+n,method:"POST",data:t}).done(function(o){console.log(o)})},del:function(n){$.ajax({url:o+"room/"+n,method:"DELETE"}).done(function(o){console.log(o)})}}})();